@Lorde’s third album, #SolarPower, emerged out of a period of exploration in her home country of New Zealand–time spent in the grass and the wind and the water, gazing up at the sun rather than down at her phone. 

It showcases her growth as an artist and individual, as she explains: “When you’re really famous as a young person, feelings get magnified. At that time, people were discussing my body on Twitter, and the natural response was to shrink away from it. Now I have a sense of my worth and my power, and my body is—awesome, for one thing. But it’s also not as central as my brain is to the whole operation. I don’t think you could make me feel bad about myself now by saying something about my body, but that’s the difference between 16 and 24. When I talk about being playful in the making of this album, there was, for want of a better word, a sexual component to that. Engaging the natural world in a big way is like a flirtation. That’s how it felt to me. Playful and joyful and a little bit nasty.”

Tap the link in our bio to read the full October profile. Photographed by @TheodeGueltzl, styled by #CamillaNickerson, written by @RobertJHaskell, Vogue, October 2021.
